--  c
CREATE TABLE Characters (
    characterId INT PRIMARY KEY,
    characterName VARCHAR(255) NOT NULL,
    villageId INT,
    clanId INT,
    beastId INT,
    birthdate DATE,
    bloodType VARCHAR(10),
    status VARCHAR(50),
    sex VARCHAR(10),
    weight FLOAT,
    age INT,
    height FLOAT,
    FOREIGN KEY (villageId) REFERENCES Villages(villageId),
    FOREIGN KEY (clanId) REFERENCES Clans(clanId),
    FOREIGN KEY (beastId) REFERENCES TailedBeastJinchuriki(beastId)
);

-- modified
CREATE TABLE CharactersNatureTypes (
    natureId VARCHAR(255),
    characterId INT,
    PRIMARY KEY (natureId, characterId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId),
    FOREIGN KEY (natureId) REFERENCES NatureTypes(natureId)
);

-- new table
CREATE TABLE NatureTypes (
    natureId INT PRIMARY KEY,
    natureType VARCHAR(255)
);

CREATE TABLE CharacterTools (
    characterId INT,
    toolId INT,
    PRIMARY KEY (characterId, toolId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId),
    FOREIGN KEY (toolId) REFERENCES Tools(toolId)
);

CREATE TABLE CharacterDebuts (
    mediaId INT,
    characterId INT,
    PRIMARY KEY (mediaId, characterId),
    FOREIGN KEY (mediaId) REFERENCES Medias(mediaId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId)
);

CREATE TABLE VoiceActorsActCharacters (
	characterId INT,
    actorId INT,
    PRIMARY KEY (characterId, actorId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId),
    FOREIGN KEY (actorId) REFERENCES VoiceActors(actorId)
);

CREATE TABLE CharactersUniqueTraits (
    trait VARCHAR(255),
    characterId INT,
    PRIMARY KEY (trait, characterId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId)
);

CREATE TABLE CharactersHaveKekkeiGenkai (
    characterId INT,
    genkaiId INT,
    PRIMARY KEY (characterId, genkaiId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId),
    FOREIGN KEY (genkaiId) REFERENCES KekkeiGenkai(genkaiId)
);

CREATE TABLE CharactersHaveJutsu (
    characterId INT,
    jutsuId INT,
    PRIMARY KEY (characterId, jutsuId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId),
    FOREIGN KEY (jutsuId) REFERENCES Jutsu(jutsuId)
);

CREATE TABLE Tools (
    toolId INT PRIMARY KEY,
    toolName VARCHAR(255) NOT NULL
);

CREATE TABLE Medias (
    mediaId INT PRIMARY KEY,
    mediaName VARCHAR(255) NOT NULL,
    mediaType VARCHAR(100) NOT NULL
);

CREATE TABLE Villages (
    villageId INT PRIMARY KEY,
    villageName VARCHAR(255) NOT NULL
);

CREATE TABLE Jutsu (
    jutsuId INT PRIMARY KEY,
    jutsuName VARCHAR(255) NOT NULL
);

CREATE TABLE VoiceActors (
    actorId INT PRIMARY KEY,
    actorName VARCHAR(255) NOT NULL,
    language VARCHAR(100) NOT NULL
);

CREATE TABLE KekkeiGenkai (
    genkaiId INT PRIMARY KEY,
    genkaiName VARCHAR(255) NOT NULL
);

CREATE TABLE Clans (
    clanId INT PRIMARY KEY,
    clanName VARCHAR(255) NOT NULL
);

CREATE TABLE Teams (
    teamId INT PRIMARY KEY,
    teamName VARCHAR(255) NOT NULL
);

CREATE TABLE TeamMembers (
    characterId INT,
    teamId INT,
    PRIMARY KEY (characterId, teamId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId),
    FOREIGN KEY (teamId) REFERENCES Teams(teamId)
);


CREATE TABLE TailedBeastJinchuriki (
    beastId INT,
    characterId INT,
    FOREIGN KEY (beastId) REFERENCES Characters(beastId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId)
);


CREATE TABLE Occupations (
    occupationId INT PRIMARY KEY,
    occupationName VARCHAR(255) NOT NULL
);

CREATE TABLE Classifications (
    classificationId INT PRIMARY KEY,
    className VARCHAR(255) NOT NULL
);

CREATE TABLE CharactersHaveRanks (
    rankId INT,
    characterId INT,
    PRIMARY KEY (rankId, characterId),
    FOREIGN KEY (rankId) REFERENCES Ranks(rankId),
    FOREIGN KEY (characterId) REFERENCES Characters(characterId)
);

CREATE TABLE Ranks (
    rankId INT PRIMARY KEY,
    period INT NOT NULL,
    rankName VARCHAR(255) NOT NULL
);



